 "paddingTop": 0,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.67vh;font-family:'Oswald';\"><B>Bale kulkul kanan</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff0000;font-size:3.11vh;font-family:'Oswald Regular';\">Bahan: batu bata merah, batu paras bali, kayu jati, ijuk </SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.65vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\"><B>Bale Kulkul Kanan</B></SPAN><SPAN STYLE=\"font-size:2.56vh;\"> merupakan salah satu struktur penting yang berada di kompleks Pura Pucak Bukit Sari, di kawasan objek wisata Sangeh, Badung, Bali. Pura Pucak Bukit Sari terkenal dengan hutan pala yang dihuni oleh ratusan kera jinak, dan menjadi destinasi wisata yang memadukan keindahan alam dengan kekayaan budaya dan spiritual Bali.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Bale Kulkul Kanan adalah sebuah bangunan tradisional yang berfungsi sebagai tempat menggantung kulkul, yaitu alat komunikasi tradisional Bali yang terbuat dari kayu dan digunakan untuk memanggil atau memberi tanda kepada masyarakat. Kulkul biasanya digantung di tempat yang tinggi, dan suara khas yang dihasilkan saat dipukul bisa terdengar dari jarak jauh. Fungsi utama kulkul ini sangat beragam, mulai dari mengumpulkan warga untuk rapat, memberikan tanda bahaya, hingga mengiringi upacara keagamaan.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Arsitektur Bale Kulkul Kanan mencerminkan estetika dan kearifan lokal Bali. Bangunan ini biasanya terbuat dari kayu dan batu, dengan hiasan ukiran yang rumit dan atap yang khas. Ukiran-ukiran tersebut tidak hanya berfungsi sebagai dekorasi, tetapi juga memiliki makna simbolis yang berkaitan dengan ajaran agama Hindu dan tradisi Bali. Bale Kulkul Kanan juga sering dihiasi dengan ornamen-ornamen khas Bali yang menambah keindahan visual serta nuansa sakral dari bangunan tersebut.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Dalam konteks Pura Pucak Bukit Sari, Bale Kulkul Kanan memiliki peran penting dalam kehidupan spiritual dan sosial masyarakat setempat. Selain berfungsi sebagai sarana komunikasi, bangunan ini juga menjadi bagian integral dari upacara dan ritual yang dilaksanakan di pura tersebut. Dengan demikian, Bale Kulkul Kanan tidak hanya merupakan elemen fisik dari kompleks pura, tetapi juga simbol dari harmoni dan kesatuan komunitas yang memelihara tradisi mereka dengan baik.</SPAN></SPAN></DIV></div>",
