 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.67vh;font-family:'Oswald';\"><B>Bale gong kiri </B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:3.11vh;font-family:'Oswald Regular';\">Bahan: kayu tradisonal, ijuk </SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:1.83vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\"><B>Bale Gong</B></SPAN><SPAN STYLE=\"font-size:2.56vh;\"> adalah salah satu bangunan khas Bali yang memiliki nilai budaya dan arsitektur tinggi. Bangunan ini biasanya digunakan untuk upacara adat, kegiatan keagamaan, dan juga sebagai tempat berkumpulnya masyarakat setempat. Bale Gong dibangun dengan bahan-bahan tradisional yang mencerminkan kearifan lokal dan keberlanjutan. Struktur utama bangunan ini terbuat dari kayu tradisional Bali,</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">yang umumnya diambil dari pohon jati, nangka, atau kelapa. Kayu-kayu ini dipilih karena ketahanannya terhadap cuaca dan serangga, serta kemampuannya untuk menopang beban berat. Atap Bale Gong biasanya terbuat dari ijuk, yang berasal dari serat pohon aren. Ijuk ini dikenal tahan terhadap panas dan hujan, serta memberikan estetika alami yang harmonis dengan lingkungan sekitar. Penggunaan bahan-bahan alami ini tidak hanya memperkuat identitas budaya Bali, tetapi juga mendukung prinsip pembangunan yang ramah lingkungan dan berkelanjutan.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
