 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.67vh;font-family:'Oswald';\"><B>Lumbung</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:5.67vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:3.11vh;font-family:'Oswald Regular';\">Bahan : kayu jati, ijuk</SPAN><SPAN STYLE=\"color:#ff361b;font-size:2.56vh;font-family:'Oswald Regular';\"> </SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\"><B>Lumbung</B></SPAN><SPAN STYLE=\"font-size:2.56vh;\"> adalah salah satu bangunan tradisional yang sering dijumpai di Bali, termasuk di objek wisata Sangeh, tepatnya di Pura Pucak Bukit Sari. Lumbung di Bali memiliki fungsi utama sebagai tempat penyimpanan hasil pertanian, terutama padi. Bangunan ini dirancang sedemikian rupa untuk menjaga kualitas dan kuantitas hasil panen dari kerusakan akibat cuaca atau hama</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\"><B>Fungsi :</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Lumbung berfungsi sebagai gudang penyimpanan padi setelah masa panen. Strukturnya dirancang untuk menjaga kelembapan dan suhu yang optimal, serta melindungi hasil panen dari serangan tikus dan serangga. Selain itu, lumbung juga sering berfungsi sebagai simbol kemakmuran dan keberkahan bagi masyarakat Bali.</SPAN></SPAN></DIV></div>",
