 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.67vh;font-family:'Oswald';\"><B>Pewaregan</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:3.66vh;font-family:'Oswald Regular';\">Bahan : kayu jati, Ijuk</SPAN><SPAN STYLE=\"color:#ff361b;font-size:3.11vh;font-family:'Oswald Regular';\"> </SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Pewaregan adalah salah satu bangunan penting dalam kompleks Pura Pucak Bukit Sari yang terletak di objek wisata Sangeh, Badung, Bali. Pewaregan berfungsi sebagai dapur suci atau tempat memasak dan mempersiapkan berbagai sesajen untuk upacara keagamaan yang diselenggarakan di pura. Bangunan ini memainkan peran krusial dalam mendukung kegiatan ritual dan upacara yang diadakan di Pura Pucak Bukit Sari.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Secara arsitektural, Pewaregan dibangun dengan mengikuti gaya tradisional Bali, menggunakan bahan-bahan lokal seperti kayu dan batu. Atapnya biasanya terbuat dari ijuk atau alang-alang, yang memberikan tampilan alami dan sejuk. Meskipun sederhana, bangunan ini didesain dengan memperhatikan prinsip-prinsip kesucian dan kebersihan, yang sangat penting dalam konteks keagamaan Bali.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Di dalam Pewaregan, terdapat peralatan memasak tradisional, seperti periuk tanah liat, tungku batu, dan berbagai alat lain yang digunakan untuk menyiapkan makanan dan sesajen. Makanan yang disiapkan di Pewaregan tidak hanya untuk persembahan kepada dewa-dewa, tetapi juga untuk para pemangku (pemimpin upacara) dan umat yang datang untuk beribadah.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Pewaregan di Pura Pucak Bukit Sari Sangeh juga mencerminkan nilai-nilai gotong royong dan kebersamaan masyarakat Bali, karena dalam proses memasak dan mempersiapkan sesajen, seringkali melibatkan partisipasi dari berbagai anggota komunitas. Ini memperlihatkan betapa eratnya hubungan antara kehidupan sosial dan spiritual dalam budaya Bali.</SPAN></SPAN></DIV></div>",
