 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;font-family:'Oswald';\"><B>Paruman Bale Lantang</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.28vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.55vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:1.83vh;font-family:'Oswald Regular';\">Bahan : kayu jati, ijuk</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:0.55vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.55vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:1.28vh;\"><B>Paruman Bale Lantang</B></SPAN><SPAN STYLE=\"font-size:1.28vh;\"> adalah salah satu bangunan tradisional yang terdapat di objek wisata Sangeh, khususnya di Pura Pucak Bukit Sari, Badung, Bali. Bangunan ini memiliki fungsi utama sebagai tempat pertemuan atau musyawarah bagi masyarakat setempat. Nama \"Paruman\" sendiri berarti rapat atau musyawarah dalam bahasa Bali, sementara \"Bale Lantang\" merujuk pada bentuk bangunan yang memanjang.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.28vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.55vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:1.28vh;\"><B>Fungsi:</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:1.28vh;\">Paruman Bale Lantang digunakan untuk berbagai kegiatan komunitas, seperti rapat desa, upacara adat, dan acara keagamaan. Tempat ini juga sering digunakan untuk pertemuan para pemangku adat dan tokoh masyarakat dalam merumuskan keputusan-keputusan penting yang berkaitan dengan kehidupan desa dan kegiatan pura.</SPAN></SPAN></DIV></div>",
