 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.67vh;font-family:'Oswald';\"><B>Gedong pengangge</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.55vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:3.11vh;font-family:'Oswald Regular';\">Bahan : batu bata merah,batu paras bali kayu jati, ijuk</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.55vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\"><B>Gedong Pengangge</B></SPAN><SPAN STYLE=\"font-size:3.11vh;\"> adalah salah satu bangunan penting yang terdapat di objek wisata Sangeh, tepatnya di Pura Pucak Bukit Sari, Badung, Bali. Bangunan ini memiliki fungsi yang sangat spesifik dan vital dalam konteks ritual dan keagamaan Hindu Bali.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:0.55vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\"><B>Fungsi:</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\">Gedong Pengangge digunakan sebagai tempat penyimpanan berbagai perlengkapan upacara dan alat-alat suci yang diperlukan dalam berbagai ritus dan upacara keagamaan di Pura Pucak Bukit Sari. Perlengkapan ini meliputi pratima (patung dewa-dewa), pralingga (simbol-simbol suci), dan berbagai jenis sarana upacara lainnya yang harus dijaga kesuciannya. Gedong Pengangge juga berfungsi sebagai tempat penyimpanan benda-benda pusaka dan bersejarah yang dimiliki oleh pura.</SPAN></SPAN></DIV></div>",
