 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.12vh;font-family:'Oswald';\"><B>Gedong Linggih Tapakan</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:3.66vh;font-family:'Oswald Regular';\">Bahan : Batu paras, kayu jati, ijuk</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.65vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Gedong Linggih</B></SPAN><SPAN STYLE=\"font-size:2.93vh;\"> </SPAN><SPAN STYLE=\"font-size:2.93vh;\"><B>Tapakan</B></SPAN><SPAN STYLE=\"font-size:2.93vh;\"> adalah salah satu struktur penting yang terdapat di Pura Pucak Bukit Sari, objek wisata Sangeh, Desa Sangeh, Badung, Bali. Bangunan ini merupakan bagian integral dari kompleks pura yang digunakan dalam berbagai upacara dan ritual keagamaan Hindu. </SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Fungsi :</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Gedong Linggih Tapakan memiliki fungsi utama sebagai tempat pemujaan dan penyimpanan benda-benda sakral, khususnya tapakan atau barong, yang merupakan perwujudan dewa-dewi Hindu dalam bentuk arca atau simbol suci. Bangunan ini digunakan oleh umat Hindu untuk memohon berkat, perlindungan, dan keselamatan. Selama upacara keagamaan, Gedong Linggih Tapakan menjadi pusat perhatian karena dianggap sebagai tempat bersemayamnya kekuatan suci yang dihormati dan dipuja oleh masyarakat setempat.</SPAN></SPAN></DIV></div>",
