 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.67vh;font-family:'Oswald';\"><B>Padma Pesimpangan ring batu karu</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:3.11vh;font-family:'Oswald Regular';\">Bahan : Batu paras bali</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Padma Pesimpangan ring Batu Karu</B></SPAN><SPAN STYLE=\"font-size:2.93vh;\"> adalah salah satu struktur suci yang terletak di Pura Pucak Bukit Sari, yang berada di kawasan objek wisata Sangeh, Desa Sangeh, Badung, Bali. Padma Pesimpangan ini merupakan salah satu tempat pemujaan yang penting dalam tradisi Hindu Bali. Nama \"Padma\" dalam konteks arsitektur Bali biasanya merujuk pada bentuk bunga teratai, yang melambangkan kesucian dan kesempurnaan dalam kepercayaan Hindu.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Sosok yang Disembah:</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Padma Pesimpangan didedikasikan untuk memuja Ida Sang Hyang Widhi Wasa, manifestasi Tuhan Yang Maha Esa dalam agama Hindu. Bangunan ini merupakan simbol pertemuan antara empat arah mata angin, yang mewakili keseimbangan dan keselarasan alam semesta.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Fungsi Bangunan:</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Padma Pesimpangan memiliki beberapa fungsi utama, yaitu:</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Tempat Persembahan:</B></SPAN><SPAN STYLE=\"font-size:2.93vh;\"> Padma Pesimpangan digunakan sebagai tempat untuk mempersembahkan sesaji kepada Ida Sang Hyang Widhi Wasa dan para dewa-dewi. Persembahan ini biasanya berupa bunga, buah-buahan, dan dupa.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Tempat Pemujaan:</B></SPAN><SPAN STYLE=\"font-size:2.93vh;\"> Padma Pesimpangan merupakan tempat suci untuk memanjatkan doa dan meditasi. Di sini, umat Hindu dapat berkomunikasi dengan Ida Sang Hyang Widhi Wasa dan para dewa-dewi untuk memohon keselamatan, kesehatan, dan kesejahteraan.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Simbol Keselarasan:</B></SPAN><SPAN STYLE=\"font-size:2.93vh;\"> Padma Pesimpangan dengan empat kelopaknya yang menghadap ke empat penjuru mata angin merupakan simbol keseimbangan dan keselarasan alam semesta. Bangunan ini mengingatkan umat Hindu untuk selalu menjaga keseimbangan dan keharmonisan dalam kehidupan mereka.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
