 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.67vh;font-family:'Oswald';\"><B>Gedong Pesimpangan Pucak Sangkung</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff0000;font-size:3.11vh;font-family:'Oswald Regular';\">Bahan : Batu andesit, Kayu jati, Ijuk</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.65vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Penjelasan Bangunan:</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Gedong Pesimpangan Pucak Sangkung adalah sebuah bangunan suci di Pura Pucak Bukit Sari, Desa Sangeh, Badung, Bali. Bangunan ini memiliki arsitektur tradisional Bali yang unik dan indah, dengan atap bersusun-susun yang terbuat dari jerami alang-alang. Gedung ini terletak di puncak bukit, sehingga menawarkan pemandangan indah ke arah desa Sangeh dan sekitarnya.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Fungsi:</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Gedong Pesimpangan Pucak Sangkung berfungsi sebagai tempat pemujaan dan peribadatan bagi umat Hindu di Desa Sangeh. Di dalam gedung ini terdapat beberapa pelinggih (tempat suci) yang dihuni oleh berbagai dewa-dewi Hindu. Umat Hindu sering datang ke Gedung Pesimpangan Pucak Sangkung untuk bersembahyang, memohon doa dan keselamatan, serta melakukan ritual keagamaan lainnya.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
