 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.67vh;font-family:'Oswald';\"><B>(Pelinggih utama) Meru Tumpeng 9</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:3.11vh;font-family:'Oswald Regular';\">Bahan : Batu andesit, Batu bata merah, Batu paras bali, kayu jati, Ijuk.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.65vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Meru Tumpang 9 </B></SPAN><SPAN STYLE=\"font-size:2.93vh;\">adalah salah satu struktur arsitektur suci yang khas dalam tradisi Hindu Bali, khususnya di Pura Pucak Bukit Sari yang terletak di Desa Sangeh, Badung, Bali. Meru adalah bangunan berbentuk pagoda bertingkat yang digunakan sebagai tempat pemujaan dewa-dewi dalam agama Hindu. Angka 9 dalam \"Meru Tumpang 9\" menunjukkan jumlah atap yang bertingkat pada bangunan tersebut, yang memiliki makna simbolis khusus dalam kepercayaan Hindu Bali, mencerminkan konsep dunia kosmis yang berlapis.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Yang di sembah:</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Di Meru Tumpang 9, dewa utama yang disembah adalah Dewa Siwa, salah satu dari Trimurti dalam agama Hindu, yang merupakan dewa pengendali dan pemusnah dalam siklus kehidupan. Selain itu, tempat ini juga digunakan untuk pemujaan kepada leluhur dan roh suci lainnya yang diyakini menjaga dan melindungi wilayah tersebut.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Fungsinya:</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Fungsi utama Meru Tumpang 9 adalah sebagai tempat pemujaan dan upacara keagamaan. Bangunan ini berfungsi sebagai titik fokus dalam berbagai ritual dan persembahyangan, terutama dalam upacara besar seperti odalan (hari ulang tahun pura). Meru ini juga dianggap sebagai tempat berkumpulnya energi spiritual yang kuat, di mana umat Hindu dapat memohon berkah, perlindungan, dan bimbingan dari para dewa dan leluhur.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
