 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.67vh;font-family:'Oswald';\"><B>Gedong Pesimpangan Ida Bhatara Ling Pucak Bon</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:3.11vh;font-family:'Oswald Regular';\">Bahan : Batu andesit, Batu bata merah, Batu paras bali, kayu jati, Ijuk</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.65vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\"><B>Penjelasan Bangunan:</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\">Gedong Pesimpangan Ida Bhatara Ling Pucak Bon adalah bangunan suci yang terletak di Pura Pucak Bukit Sari, Desa Sangeh, Badung, Bali. Bangunan ini merupakan tempat pemujaan Ida Bhatara Ling Pucak Bon, salah satu dewa yang disucikan di pura tersebut.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\">Bangunan ini memiliki ciri khas arsitektur Bali yang kental, dengan atap tumpang tindih dan hiasan ukiran yang rumit. Bagian depan bangunan terdapat pelinggih (tempat pemujaan) yang dihiasi dengan patung Ida Bhatara Ling Pucak Bon. Di sekitar pelinggih terdapat berbagai sesajen dan persembahan yang diberikan oleh para umat.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\"><B>Siapa yang Disembah:</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\">Di dalam Gedong Pesimpangan Ida Bhatara Ling Pucak Bon, dewa yang disembah adalah Ida Bhatara Ling Pucak Bon. Beliau adalah salah satu manifestasi dari Ida Sang Hyang Widhi Wasa, dewa tertinggi dalam agama Hindu di Bali. Ida Bhatara Ling Pucak Bon diyakini sebagai pelindung desa Sangeh dan sekitarnya.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\"><B>Fungsinya:</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\">Gedong Pesimpangan Ida Bhatara Ling Pucak Bon berfungsi sebagai tempat pemujaan dan persembahan untuk Ida Bhatara Ling Pucak Bon. Para umat datang ke sini untuk memanjatkan doa, memohon keselamatan, dan mengucapkan rasa syukur. Bangunan ini juga menjadi tempat peribadatan dan meditasi bagi para umat Hindu.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
