 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.67vh;font-family:'Oswald';\"><B>Pelinggih Bale Peselang</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:3.11vh;font-family:'Oswald Regular';\">Bahan : Batu paras bali, Kayu jati, Ijuk</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.65vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\"><B>Palinggih Bale Paselang.</B></SPAN><SPAN STYLE=\"font-size:2.56vh;\"> Pelinggih ini umumnya digunakan untuk upacara Pedanaan yang menggambarkan hubungan manusia dengan Tuhan. Di palinggih ini dilukiskan secara ritual sakral hubungan bakti manusia kepada Tuhan dan anugerah Tuhan yang di Bali disebut sweca. Di Palinggih Paselang inilah dilukiskan bahwa hanya manusia yang sungguh-sungguh bakti pada Tuhan akan mendapatkan sweca atau anugerah dari Tuhan berupa raksanam atau rasa aman dan damai serta dhanam alias hidup sejahtera. Ini artinya, palinggih yang disebut Bale Paselang ini memotivasi umat Hindu agar jangan hanya memohon wara nugraha Hyang Widhi tanpa melakukan bakti dan pelayanan pada sesama dan menyayangi isi alam ini.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
