 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.67vh;font-family:'Oswald';\"><B>Bale Pepelik</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:3.11vh;font-family:'Oswald Regular';\">Bahan : Batu bata merah, batu paras bali, kayu jati, Ijuk</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.65vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Bale Pepelik </B></SPAN><SPAN STYLE=\"font-size:2.93vh;\">adalah salah satu jenis bangunan tradisional Bali yang dapat ditemukan di Pura Pucak Bukit Sari, objek wisata Sangeh, Desa Sangeh, Badung, Bali. Bale ini memiliki karakteristik arsitektur khas Bali dengan atap yang menjulang tinggi dan struktur yang terbuka di sekelilingnya.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Fungsi Bale Pepelik:</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Fungsi utama Bale Pepelik adalah sebagai tempat persiapan dan penyimpanan sarana upacara keagamaan. Dalam konteks Pura Pucak Bukit Sari, Bale Pepelik digunakan untuk menyimpan perlengkapan ritual, seperti sesaji dan perlengkapan lainnya yang digunakan dalam upacara keagamaan. Selain itu, Bale Pepelik juga sering digunakan sebagai tempat beristirahat para pemangku (pemimpin upacara) serta para pemedek (umat) yang datang untuk sembahyang.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.65vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
