 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:6.4vh;font-family:'Oswald';\"><B>Gedong Pesimpangan Ida Bhatara pura pucak mangu</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:6.4vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:3.11vh;font-family:'Oswald Regular';\">Bahan : Batu andesit, kayu jati, Ijuk .</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Gedong Pesimpangan Ida Bhatara Pura Pucak Mangu </B></SPAN><SPAN STYLE=\"font-size:2.93vh;\">merupakan sebuah bangunan suci dalam kompleks Pura Pucak Mangu di Desa Sangeh, Badung, Bali. Gedong ini berfungsi sebagai tempat pemujaan Ida Bhatara Mangu, manifestasi Dewa Wisnu yang berstana di pura tersebut.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Bangunan Gedong Pesimpangan memiliki arsitektur khas Bali dengan beberapa ciri khas, seperti:</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Bentuk:</B></SPAN><SPAN STYLE=\"font-size:2.93vh;\"> Gedong berbentuk joglo dengan atap bertingkat yang terbuat dari jerami alang-alang.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Ornamen: Dihiasi dengan berbagai ornamen ukiran kayu yang rumit dan indah, seperti motif bunga, daun, dan dewa-dewi Hindu.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Warna: Didominasi warna merah, kuning, dan putih, yang memiliki makna spiritual dalam budaya Hindu.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Dewa yang Disembah :</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Gedong Pesimpangan Ida Bhatara Pura Pucak Mangu didedikasikan untuk memuja Ida Bhatara Mangu, manifestasi Dewa Wisnu yang dipercaya sebagai pelindung Desa Sangeh dan sekitarnya. Dewa Wisnu adalah salah satu dari tiga dewa utama dalam agama Hindu, bersama dengan Dewa Brahma dan Dewa Siwa.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Dewa Wisnu dikenal sebagai dewa pemelihara dan pelindung alam semesta. Beliau digambarkan dengan empat tangan yang memegang berbagai atribut, seperti cakram, gada, terompet, dan bunga teratai.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Fungsi Gedong Pesimpangan :</B></SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\">Gedong Pesimpangan Ida Bhatara Pura Pucak Mangu memiliki beberapa fungsi utama, yaitu:</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Tempat Pemujaan:</B></SPAN><SPAN STYLE=\"font-size:2.93vh;\"> Digunakan sebagai tempat umat Hindu untuk melakukan persembahan dan doa kepada Ida Bhatara Mangu.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.93vh;\"><B>Tempat Upacara:</B></SPAN><SPAN STYLE=\"font-size:2.93vh;\"> Menjadi lokasi berbagai upacara keagamaan Hindu, seperti Pujan, Piodalan, dan Galungan.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.93vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:1.65vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><p STYLE=\"margin:0; line-height:1.65vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
