 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.67vh;font-family:'Oswald';\"><B>Padma sari Pelinggih Ida Bhata Dalem Nusa</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:2.56vh;font-family:'Oswald Regular';\">Bahan : Batu paras bali</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.65vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\"><B>Padma Sari, Pelinggih Ida Bhatara Dalem Nusa adalah</B></SPAN><SPAN STYLE=\"font-size:3.11vh;\"> salah satu pelinggih yang terdapat di kompleks Pura Pucak Bukit Sari, yang terletak di Desa Sangeh, Kabupaten Badung, Bali. Bangunan ini memiliki arsitektur khas Bali dengan detail ukiran yang indah dan mengagumkan. Dibangun dengan menggunakan bahan-bahan tradisional Bali seperti batu dan kayu, Padma Sari menjadi salah satu titik fokus penting dalam kompleks pura ini.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\"><B>Siapa yang Disembah:</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\">Ida Bhatara Dalem Nusa adalah dewa pelindung Desa Sangeh.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\">Beliau diwujudkan dalam bentuk arca dan pratima yang diletakkan di pelinggih Padma Sari.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\"><B>Fungsinya Apa:</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:3.11vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\">Pelinggih Padma Sari berfungsi sebagai tempat pemujaan Ida Bhatara Dalem Nusa.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\">Di sini, umat Hindu memanjatkan doa dan memohon perlindungan kepada beliau.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:3.11vh;\">Pelinggih ini juga menjadi tempat peribadatan utama di Pura Pucak Bukit Sari.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.65vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p></div>",
