 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.41vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:5.67vh;font-family:'Oswald';\"><B>Icon patung</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:3.11vh;font-family:'Oswald Regular';\">Bahan: batu adensit,</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.65vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Patung kera di Objek Wisata Sangeh, Desa Sangeh, Badung, Bali merupakan salah satu ikon wisata yang terkenal dan menarik perhatian banyak pengunjung. Patung-patung kera ini bukan hanya dekorasi semata, tetapi memiliki makna dan simbolisme yang mendalam bagi masyarakat Hindu di Desa Sangeh dan sekitarnya.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Makna dan Simbolisme:</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Keberuntungan: Kera dalam budaya Hindu sering dikaitkan dengan keberuntungan dan kesuburan. Patung kera di Sangeh dipercaya membawa keberuntungan bagi pengunjung dan desa.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Penjaga Hutan: Kera di Sangeh dianggap sebagai penjaga hutan lindung yang mengelilingi pura. Patung kera ini melambangkan peran penting kera dalam menjaga keseimbangan alam.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Kesatuan Manusia dan Alam: Kera di Sangeh hidup berdampingan secara damai dengan manusia. Patung kera ini mengingatkan kita akan pentingnya menjaga hubungan yang harmonis dengan alam.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Kisah Ramayana: Patung kera di Sangeh juga dikaitkan dengan kisah Ramayana, di mana kera-kera membantu Rama dalam pertempuran melawan Rahwana. Patung kera ini melambangkan keberanian, kesetiaan, dan kerjasama.</SPAN></SPAN></DIV><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Sejarah dan Keunikan:</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Patung kera di Sangeh dibuat dalam berbagai bentuk dan ukuran. Ada patung kera yang sedang duduk, memanjat, bermain, atau bahkan bertarung. Patung-patung ini terbuat dari bahan alami seperti kayu dan bambu, dan dihiasi dengan ukiran-ukiran yang indah.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Keunikan patung kera di Sangeh terletak pada ekspresinya yang realistis dan interaktif. Pengunjung seringkali berfoto dengan patung kera ini, bahkan berpura-pura berinteraksi dengan mereka. Hal ini membuat patung kera menjadi salah satu spot foto favorit di Sangeh.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Lokasi dan Akses:</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Patung kera di Sangeh dapat ditemukan di berbagai tempat di sekitar pura dan hutan lindung. Pengunjung dapat dengan mudah menemukannya saat berjalan-jalan di sekitar objek wisata.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.56vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.1vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:2.56vh;\">Objek Wisata Sangeh terletak di Desa Sangeh, Kecamatan Abiansemal, Kabupaten Badung, Bali. Akses menuju Sangeh cukup mudah, dapat ditempuh dengan kendaraan pribadi atau kendaraan umum.</SPAN></SPAN></DIV></div>",
