 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.48vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:6.2vh;font-family:'Oswald';\"><B>Padmasari</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.83vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.2vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:2.83vh;font-family:'Oswald Regular';\">Dolor sit amet, consectetur adipiscing elit. Nunc porttitor ac nulla vitae bibendum.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.74vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.2vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:1.74vh;font-family:'Poppins SemiBold';\">Pelinggih Padma Sari biasanya berbentuk sebuah padmasana (singgasana bunga teratai) yang melambangkan tempat duduk dewa-dewa. Padmasana ini sering kali dihiasi dengan ornamen yang melambangkan keindahan dan kesucian teratai, bunga yang sering dikaitkan dengan penciptaan dan kesucian dalam ajaran Hindu.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.74vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.2vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:1.74vh;font-family:'Poppins SemiBold';\">Kegunaan utama dari Padma Sari adalah sebagai tempat untuk meletakkan sesajen dan melakukan persembahyangan untuk memohon berkah dari Dewa Brahma. Umat Hindu Bali datang ke pelinggih ini untuk berdoa, memohon perlindungan, kesuburan, dan kelancaran dalam segala aspek kehidupan mereka. Upacara-upacara tertentu, seperti odalan (upacara ulang tahun pura), juga sering dilakukan di pelinggih ini untuk menghormati dan menyembah Dewa Brahma.</SPAN></SPAN></DIV></div>",
