 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:8.48vh;font-family:'Bebas Neue Bold';\">___</SPAN></SPAN></DIV><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:6.2vh;font-family:'Oswald';\"><B>Piasan</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:2.83vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.2vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff361b;font-size:2.17vh;font-family:'Oswald Regular';\">Bahan : batu andensit, Kayu jati , Ijuk</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:1.74vh;\"><BR STYLE=\"letter-spacing:0vh;color:#000000;font-size:1.2vh;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0vh;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:1.85vh;font-family:'Poppins SemiBold';\">Piasan biasanya terletak di halaman pura atau di dalam area tertentu yang dikhususkan untuk kegiatan persembahan. Fungsi utama dari piasan adalah sebagai altar atau meja tempat meletakkan banten (sesajen) yang ditujukan untuk memuja dewa-dewi, roh leluhur, dan makhluk suci lainnya dalam keyakinan Hindu Bali. Persembahan ini merupakan bentuk rasa syukur, permohonan, dan penghormatan kepada kekuatan-kekuatan spiritual. Dengan adanya piasan, umat Hindu Bali dapat dengan tertib dan sakral menempatkan persembahan mereka, sehingga prosesi keagamaan dapat berlangsung dengan khidmat dan sesuai dengan tata cara yang ditentukan oleh tradisi dan adat istiadat Bali.</SPAN></SPAN></DIV></div>",
